INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES (4, 0.0, "2030/12/17 14:59:59", 24, 4, 110501, 0.0, 1, "カオリ（サマー）", "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 10021, "2019/07/31 12:00:00", 24015, 0.0);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES (4, 0.0, "2030/12/17 14:59:59", 24, 1, 110501, 0.0, 2, "カオリ（サマー）", "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 10021, "2019/07/31 12:00:00", 24016, 4.0);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES (4, 0.0, "2030/12/17 14:59:59", 24, 4, 110501, 0.0, 3, "カオリ（サマー）", "マジムンだらけで目が回るさ～！\nふらふらさ～！", 10021, "2019/07/31 12:00:00", 24017, 0.0);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES (1, 0.0, "2030/12/17 14:59:59", 24, 2, 110501, 0.0, 4, "カオリ（サマー）", "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 10021, "2019/07/31 12:00:00", 24018, 5.2);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES (5, 0.0, "2030/12/17 14:59:59", 24, 6, 110501, 0.0, 5, "カオリ（サマー）", "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 10021, "2019/07/31 12:00:00", 24019, 4.2);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES (2, 0.0, "2030/12/17 14:59:59", 24, 2, 110501, 0.0, 6, "カオリ（サマー）", "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 10021, "2019/07/31 12:00:00", 24020, 0.0);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES (1, 0.0, "2030/12/17 14:59:59", 24, 6, 110501, 0.0, 7, "カオリ（サマー）", "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 10021, "2019/07/31 12:00:00", 24021, 6.4);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES (2, 0.0, "2030/12/17 14:59:59", 24, 2, 110501, 0.0, 8, "カオリ（サマー）", "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 10021, "2019/07/31 12:00:00", 24022, 0.0);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES (6, 0.0, "2030/12/17 14:59:59", 24, 3, 110501, 0.0, 9, "カオリ（サマー）", "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 10021, "2019/07/31 12:00:00", 24023, 10.08);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES (1, 0.0, "2030/12/17 14:59:59", 24, 2, 110501, 0.0, 10, "カオリ（サマー）", "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 10021, "2019/07/31 12:00:00", 24024, 5.0);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES (2, 0.0, "2030/12/17 14:59:59", 24, 2, 110501, 0.0, 11, "カオリ（サマー）", "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 10021, "2019/07/31 12:00:00", 24025, 0.0);
